  false,\n\t\"url\": null,\n\t\"notes\": \"Report for the 1980 field season on a study
  of muskrat population dynamics and vegetation utilization, being led by Utah State
  University for a doctorate dissertation. The study objectives are as follows: (1)
  Estimate population parameters for the muskrats in the study area (i.e. size, fecundity,
  and age and sex structure), (2) Determine and evaluate the degree of utilization
  of the marsh vegetation by a known population of muskrats, and (3) Provide a management
  plan for muskrats and marsh habitat based on population and utilization parameters.
  During the 1980 field season (April-October), research efforts concentrated on correlating
  vegetation utilization rates with known populations of muskrats. Four repetitions
  of the experimental design were conducted from July through October. A clipped stem
  regrowth standard was determined for each experiment period. Data on simulated feeding
  activity was collected monthly from June through October. In order to ascertain
  the relationship between feeding preference and available vegetation, the vegetation
  within the enclosures was mapped and the cover value for the emergent Olney's bulrush
  (Scirpus olneyi) was determined. Stomach analysis is being conducted to further
  delineate food preferences. A simulation of the field technique was conducted in
  September. Laboratory analysis was conducted all summer, but has received emphasis
  for November and December. Compilation of the experimental data and computer analysis
  is planned for the first quarter of 1981.\",\n\t\"owner_org\": \"4d7ad1cd-3641-420b-8116-e4082f49cd44\",\n\t\"extras\":
